        "title" : "Hội thảo Nghề nghiệp với Tập đoàn Olam 2019",
        "content" : "<p>Olam International l&agrave; 1 tập đo&agrave;n sản suất c&aacute;c sản phẩm n&ocirc;ng sản h&agrave;ng đầu thế giới, c&oacute; trụ sở ch&iacute;nh tại Sinhgapore. Hoạt động tr&ecirc;n 71 quốc gia. Tại Việt Nam, Olam c&oacute; 13 chi nh&aacute;nh tập trung tại c&aacute;c tỉnh th&agrave;nh: Tp.HCM, Đắk Lắk, Gia Lai, Lam Đồng, Đồng Nai, Long An, Quy Nhơn, Ph&uacute; Y&ecirc;n. Olam Việt Nam chuy&ecirc;n sản xuất c&aacute;c mặt h&agrave;ng n&ocirc;ng sản c&oacute; gi&aacute; trị kinh tế cao như: Caf&eacute;, Điều, Ti&ecirc;u, Gạo&hellip;</p>\n\n<p><u><strong>Giới thiệu về Tập Đo&agrave;n Olam</strong></u></p>\n\n<ul>\n\t<li>Olam c&oacute; 27 năm hoạt động &amp; ph&aacute;t triển, Olam trở th&agrave;nh tập đo&agrave;n h&agrave;ng đầu thế giới về hoạt động v&agrave; kinh doanh n&ocirc;ng sản;</li>\n\t<li>Trụ sở ch&iacute;nh tại Singapore. được ni&ecirc;m yết tại Sở Giao Dịch Chứng Kho&aacute;n Singapore từ năm 2005;</li>\n\t<li>C&oacute; mặt tr&ecirc;n 70 l&atilde;nh thổ quốc gia với 25,000 nh&acirc;n vi&ecirc;n, phục vụ tr&ecirc;n 16,000 kh&aacute;ch h&agrave;ng khắp thế giới;</li>\n\t<li>Sản xuất, kinh doanh 16 mặt h&agrave;ng chủ lực, tạo ra 44 mặt h&agrave;ng n&ocirc;ng sản</li>\n\t<li>Kh&aacute;ch h&agrave;ng của c&ocirc;ng ty bao gồm những tập đo&agrave;n đa quốc gia h&agrave;ng đầu thế giới như Kraft Foods, Nestl&eacute;, Lavazza, Mars, Tchibo v&agrave; Planters.</li>\n</ul>\n\n<p><u><strong>Người tham dự:</strong></u></p>\n\n<ul>\n\t<li><strong>Mr. Ng&ocirc; Duy Khang</strong>: Gi&aacute;m đốc nh&acirc;n sự Olam Việt Nam</li>\n\t<li><strong>Mr Trung</strong>: Production Manager Nh&agrave; m&aacute;y Caf&eacute; Outspan Long An</li>\n\t<li><strong>Ms. Nguyễn H&agrave; Thảo</strong>: Chuy&ecirc;n vi&ecirc;n tuyển dụng Olam Việt Nam</li>\n</ul>\n\n<p><u><strong>Thời gian v&agrave; địa điểm tổ chức:</strong></u></p>\n\n<ul>\n\t<li>Thời gian:&nbsp;<strong>8:30am đến 11:30am Ng&agrave;y 03/12/2018</strong></li>\n\t<li>Địa điểm:<strong>&nbsp;Hội trường B4</strong>, Trường Đại học B&aacute;ch Khoa TP.HCM</li>\n\t<li>Link đăng k&yacute; tham dự:&nbsp;<a href=\"https://goo.gl/forms/HqzkypeYCLqkk2su1\">https://goo.gl/forms/HqzkypeYCLqkk2su1</a></li>\n</ul>\n\n<p><u><strong>Nội dung chương tr&igrave;nh</strong></u></p>\n\n<p>Chương tr&igrave;nh Career Talk 2018 l&agrave; Chương tr&igrave;nh được thực hiện nhằm giới thiệu đến sinh vi&ecirc;n Trường c&aacute;c th&ocirc;ng tin về Tập Đo&agrave;n Olam v&agrave; Olam Việt Nam, chia sẻ c&aacute;c c&acirc;u chuyện sản xuất thực tiễn li&ecirc;n quan đến kiến thức chuy&ecirc;n ng&agrave;nh, đồng thời khởi động chia sẻ về chương tr&igrave;nh Graduated Engineering Trainee 2019 tại Olam Việt Nam.</p>\n",
